import React, { useContext,useEffect } from 'react';
import {LoadingContext} from '../store/Store';

function AddWorkspace() {
    const [,setLoading] = useContext(LoadingContext);
    useEffect(() => {
        setLoading(false)
      });


  return (
    <div className="wrapper">
        <div className="container-fluid">
            <div className="row">
                <div className="col-12">
                <div class="card"><div class="card-body"><h4 class="mt-0 header-title">Validation type</h4><p class="text-muted m-b-30">Parsley is a javascript form validation library. It helps you provide your users with feedback on their form submission before sending it to your server.</p><form class="" action="#" novalidate=""><div class="form-group"><label>Required</label> <input type="text" class="form-control" required="" placeholder="Type something"/></div><div class="form-group"><label>Equal To</label><div><input type="password" id="pass2" class="form-control" required="" placeholder="Password"/></div><div class="m-t-10"><input type="password" class="form-control" required="" data-parsley-equalto="#pass2" placeholder="Re-Type Password"/></div></div><div class="form-group"><label>E-Mail</label><div><input type="email" class="form-control" required="" parsley-type="email" placeholder="Enter a valid e-mail"/></div></div><div class="form-group"><label>URL</label><div><input parsley-type="url" type="url" class="form-control" required="" placeholder="URL"/></div></div><div class="form-group"><label>Digits</label><div><input data-parsley-type="digits" type="text" class="form-control" required="" placeholder="Enter only digits"/></div></div><div class="form-group"><label>Number</label><div><input data-parsley-type="number" type="text" class="form-control" required="" placeholder="Enter only numbers"/></div></div><div class="form-group"><label>Alphanumeric</label><div><input data-parsley-type="alphanum" type="text" class="form-control" required="" placeholder="Enter alphanumeric value"/></div></div><div class="form-group"><label>Textarea</label><div><textarea required="" class="form-control" rows="5"></textarea></div></div><div class="form-group mb-0"><div><button type="submit" class="btn btn-primary waves-effect waves-light mr-1">Submit</button> <button type="reset" class="btn btn-secondary waves-effect">Cancel</button></div></div></form></div></div>
                </div>
            </div>
        </div>
    </div>
)

}

export default AddWorkspace
